USE mysqldb;

CREATE TABLE IF NOT EXISTS `STUFF` (
  `STUFF_ID` int NOT NULL AUTO_INCREMENT COMMENT 'スタッフID',
  `STORE_ID` int NOT NULL COMMENT '店舗ID',
  `LAST_NAME` varchar(30) NOT NULL COMMENT '姓',
  `FIRST_NAME` varchar(30) NOT NULL COMMENT '名',
  `LAST_NAME_KANA` varchar(30) NOT NULL COMMENT 'セイ',
  `FIRST_NAME_KANA` varchar(30) NOT NULL COMMENT 'メイ',
  `RANK` varchar(255) NOT NULL COMMENT 'ランク',
  `BIRTHDAY` date DEFAULT NULL COMMENT '生年月日',
  `AGE` int DEFAULT NULL COMMENT '年齢',
  `GENDER` int NOT NULL COMMENT '性別',
  `POSTAL_CODE` varchar(7) DEFAULT NULL COMMENT '郵便番号',
  `PREFECTURE_ID` int DEFAULT NULL COMMENT '都道府県',
  `ADDRESS1` varchar(45) DEFAULT NULL COMMENT '住所1',
  `ADDRESS2` varchar(45) DEFAULT NULL COMMENT '住所2',
  `ADDRESS3` varchar(45) DEFAULT NULL COMMENT '住所3',
  `PHONE_NUMBER` varchar(11) DEFAULT NULL COMMENT '電話番号',
  `EMAIL` varchar(255) NOT NULL COMMENT 'メールアドレス',
  `PASSWORD` varchar(255) NOT NULL COMMENT 'パスワード',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`STUFF_ID`),
  UNIQUE KEY `EMAIL_INDEX` (`EMAIL`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='スタッフ';

CREATE TABLE IF NOT EXISTS `CUSTOMER` (
  `CUSTOMER_ID` int NOT NULL AUTO_INCREMENT COMMENT '顧客ID',
  `STORE_ID` int NOT NULL COMMENT '店舗ID',
  `LAST_NAME` varchar(30) NOT NULL COMMENT '姓',
  `FIRST_NAME` varchar(30) NOT NULL COMMENT '名',
  `LAST_NAME_KANA` varchar(30) NOT NULL COMMENT 'セイ',
  `FIRST_NAME_KANA` varchar(30) NOT NULL COMMENT 'メイ',
  `BIRTHDAY` date DEFAULT NULL COMMENT '生年月日',
  `AGE` int DEFAULT NULL COMMENT '年齢',
  `GENDER` int NOT NULL COMMENT '性別',
  `POSTAL_CODE` varchar(7) DEFAULT NULL COMMENT '郵便番号',
  `PREFECTURE_ID` int DEFAULT NULL COMMENT '都道府県',
  `ADDRESS1` varchar(45) DEFAULT NULL COMMENT '住所1',
  `ADDRESS2` varchar(45) DEFAULT NULL COMMENT '住所2',
  `ADDRESS3` varchar(45) DEFAULT NULL COMMENT '住所3',
  `PHONE_NUMBER` varchar(11) DEFAULT NULL COMMENT '電話番号',
  `EMAIL` varchar(255) NOT NULL COMMENT 'メールアドレス',
  `PASSWORD` varchar(255) NOT NULL COMMENT 'パスワード',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`CUSTOMER_ID`),
  UNIQUE KEY `EMAIL_INDEX` (`EMAIL`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='顧客';

CREATE TABLE IF NOT EXISTS `STORE_HEADER` (
  `STORE_ID` int NOT NULL AUTO_INCREMENT COMMENT '店舗ID',
  `STORE_NAME` varchar(255) NOT NULL COMMENT '店舗名',
  `POSTAL_CODE` varchar(7) DEFAULT NULL COMMENT '郵便番号',
  `PREFECTURE_ID` int DEFAULT NULL COMMENT '都道府県',
  `ADDRESS1` varchar(45) DEFAULT NULL COMMENT '住所1',
  `ADDRESS2` varchar(45) DEFAULT NULL COMMENT '住所2',
  `ADDRESS3` varchar(45) DEFAULT NULL COMMENT '住所3',
  `PHONE_NUMBER` varchar(11) DEFAULT NULL COMMENT '電話番号',
  `EMAIL` varchar(255) NOT NULL COMMENT 'メールアドレス',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`STORE_ID`),
  UNIQUE KEY `EMAIL_INDEX` (`EMAIL`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='店舗';

CREATE TABLE IF NOT EXISTS `STORE_BUSINESS` (
  `STORE_ID` int NOT NULL COMMENT '店舗ID',
  `WEEKS` int NOT NULL COMMENT '週',
  `DAY_OF_WEEK` int NOT NULL COMMENT '曜日',
  `BUSINESS_START` time NOT NULL COMMENT '営業開始時間',
  `BUSINESS_END` time NOT NULL COMMENT '営業終了時間',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`STORE_ID`, `WEEKS`, `DAY_OF_WEEK`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='店舗営業';

CREATE TABLE IF NOT EXISTS `RANK_BY_STORE` (
  `RANK_BY_STORE_ID` int NOT NULL AUTO_INCREMENT COMMENT '店舗別ランクID',
  `STORE_ID` int NOT NULL COMMENT '店舗ID',
  `RANK_ID` int NOT NULL COMMENT 'ランクID',
  `RANK` varchar(255) NOT NULL COMMENT 'ランク',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`RANK_BY_STORE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='店舗別ランク';

CREATE TABLE IF NOT EXISTS `MENU_HEADER` (
  `STORE_ID` int NOT NULL COMMENT '店舗ID',
  `MENU_ID` int NOT NULL COMMENT 'メニューID',
  `MENU` varchar(255) NOT NULL COMMENT 'メニュー',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`STORE_ID`, `MENU_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='メニュー';

CREATE TABLE IF NOT EXISTS `MENU_DETAIL` (
  `STORE_ID` int NOT NULL COMMENT '店舗ID',
  `MENU_ID` int NOT NULL COMMENT 'メニューID',
  `RANK_BY_STORE_ID` int NOT NULL COMMENT '店舗別ランクID',
  `PRICE` int NOT NULL COMMENT '料金',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`STORE_ID`, `MENU_ID`, `RANK_BY_STORE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='メニュー詳細';

CREATE TABLE IF NOT EXISTS `RESERVE_HISTORY` (
  `RESERVE_HISTORY_ID` int NOT NULL AUTO_INCREMENT COMMENT '予約履歴ID',
  `STORE_ID` int NOT NULL COMMENT '店舗ID',
  `CUSTOMER_ID` int NOT NULL COMMENT '顧客ID',
  `STUFF_ID` int NOT NULL COMMENT 'スタッフID',
  `RANK` varchar(255) DEFAULT NULL COMMENT 'ランク',
  `MENU` varchar(255) DEFAULT NULL COMMENT 'メニュー',
  `PRICE` int DEFAULT NULL COMMENT '料金',
  `RESERVE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '予約日時',
  `RESERVE_STATE` int NOT NULL COMMENT '予約状態',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`RESERVE_HISTORY_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='予約履歴';

CREATE TABLE IF NOT EXISTS `SALES_HISTORY` (
  `SALES_HISTORY_ID` int NOT NULL AUTO_INCREMENT COMMENT '来店履歴ID',
  `RESERVE_HISTORY_ID` int NOT NULL COMMENT '予約履歴ID',
  `STORE_ID` int NOT NULL COMMENT '店舗ID',
  `CUSTOMER_ID` int NOT NULL COMMENT '顧客ID',
  `STUFF_ID` int NOT NULL COMMENT 'スタッフID',
