  `MENU` varchar(255) DEFAULT NULL COMMENT 'メニュー',
  `PRICE` int DEFAULT NULL COMMENT '料金',
  `SALES_DATETIME` timestamp NULL DEFAULT NULL COMMENT '来店日時',
  `DELETE_FLG` int DEFAULT '0' COMMENT '削除フラグ',
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `CREATED_USER` int DEFAULT NULL COMMENT '作成者ID',
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `UPDATE_USER` int DEFAULT NULL COMMENT '更新者ID',
  `VERSION_EX_KEY` int DEFAULT '0' COMMENT '排他制御カラム',
  PRIMARY KEY (`SALES_HISTORY_ID`),
  UNIQUE KEY `RESERVE_HISTORY_ID_INDEX` (`RESERVE_HISTORY_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='来店履歴';
